query QueryRenderersFairQuery(
  $fairID: String!
) {
  fair(id: $fairID) {
    ...Fair_fair
    __id
  }
}

fragment Fair_fair on Fair {
  ...FairHeader_fair
  id
  hours
  location {
    ...LocationMap_location
    __id
  }
  organizer {
    profile {
      name
      __id
    }
  }
  __id
}

fragment FairHeader_fair on Fair {
  id
  name
  image {
    image_url
    aspect_ratio
    url
  }
  organizer {
    profile {
      icon {
        id
        href
        height
        width
        url
      }
      name
      __id
    }
  }
  start_at
  end_at
  __id
}

fragment LocationMap_location on Location {
  __id
  id
  city
  address
  address_2
  display
  coordinates {
    lat
    lng
  }
  day_schedules {
    start_time
    end_time
    day_of_week
  }
}
